  JWILLIAMS, Cecil Jeanette and BLITHE, Graham William
  JBLITHE, Allan Noel and LAMBESS, Julie Anne
  02> BLITHE, Allan Noelm on 01.12.1990 to LAMBESS, Julie Anne
  b 09.01.1966
  b 04.08.1966
  Allan b, and m. at Masterton. Separated. Julie, d/o Errol Lambess and June Hayward, b. at
  Masterton.
  Allan is a police sergeant stationed in Wellington and living in Lower Hutt.
  03> BLITHE, Darren Ewan
  b 22.11.1971
  Darren b. at Masterton. He is a sales engineer for CSL, presently based in Christchurch.
  05> WILLIAMS, Fritz Leslie m on 19.12.1934 to COBB, Doreen Margaret
  b 21.06.1905 d 17.01.1979
  b 31.03.1917 d 26.05.1963
  Fritz b. at Pukehou, m, at Chateau Tongariro, d. at Auckland and cremated, Doreen d, at Titirangi and
  cremated.
  Fritz was educated at Huntley School, Marton (1916-19) and Wanganui Collegiate School (1920-22). He
  travelled to Europe in 1930-31 and toured particularly in Germany and Norway. He farmed with his elder
  brother, Brian, at "Kutere" (1932-33) before acquiring his own property, "Waimaria", of 600 acres at Kaeaea
  near Aria in the King Country (1934-47). He served in Egypt and Italy (1941-45) in 3 Platoon, 6RMT (No
  28123) and was discharged as a Corporal.
  Doreen served in the WRAAF in New Zealand (1941-45). She and Fritz established and operated a holiday
  motor camp at Ohope, Bay of Plenty (1947-60) and retired to Titirangi, Auckland. After Doreen's death
  Fritz moved to Torbay and assisted with the building and extension of his own and both his sons' homes. He
  was researching the pre-New Zealand origins of the Williams family until his death in 1979.
  01> WILLIAMS, John m on 15.12.1962 to BELL, Jeanette Storey
  b 21.10.1935
  b 05.07.1938
  John b. at Piopio and m. at Clevedon Presbyterian Church. Jeanette, d/o Alan Storey Bell and Mavis Jean
  McCullough (dairy farmers of Clevedon). Jeanette b, at Otahuhu. Address: 46 Riverpark Drive, Annandale,
  Townsville 4814, Qld, Australia.
  John was educated at Kaeaea School, Southwell School, Hamilton (1942-47), Whakatane High School
  (1948-52), and Ardmore Engineering School, Auckland University College from which he graduated with a
  Masters Degree in Engineering. He worked for Napier City Council (1958-59) then moved to Townsville,
  QInd, Australia in 1960 to join the consulting engineering firm of McIntyre & Associates where he
  developed a professional career as a water and wastewater engineer. John's community service has
  included 25 years as a Rotarian (Paul Harris Fellow), various educational committees and councils
  progressively from Kindergarten (1964-68), through the Townsville College of Advanced Education
  (1978-81) to the Council of the James Cook University of North Queensland (1982-) where he is Deputy
  Chancellor (1989-).
  Jeanette trained in business studies and between raising four children, served as secretary or
  treasurer of community committees for the children's schools and after-school activities, and costume
  designer and seamstress for drama and ballet activities. After the children graduated from school she
  returned to business as a self taught computer programmer assisting in John's company.
  01> WILLIAMS, Christopher David
  b 20.09.1963
  Christopher b. at Townsville, Qind, Australia.
  Christopher was educated at Mundingburra State School, Townsville (1969-75), All Souls & St
  Gabriel's School, Charters Towers (1976-80) where he was Dux of the school and Best Army Cadet in
  his final year, and James Cook University of North Queensland (1981-84) where he graduated with a
  Bachelors Degree (1st Class Honours) in Engineering. He worked for McIntyre and Associates
  (1985-91) in various parts of Queensland before taking leave to travel overseas and is now working
  for a firm of consulting engineers in Manchester, England.
